import Banner from "../components/Banner";

export default function Tokushima() {
  return (
    <div>
      <Banner
        title="德島"
        subtitle="阿波舞與鳴門漩渦的熱情之地"
        imageUrl="https://images.unsplash.com/photo-1534269222346-5a2f9faabf6c"
      />
      <div className="mt-6 space-y-4 text-gray-700">
        <p>德島是著名的阿波舞發源地，夏天的祭典熱鬧非凡。</p><p>鳴門海峽的自然奇觀——漩渦，也吸引無數遊客前來朝聖。</p>
      </div>
    </div>
  );
}
